import React from "react";

const Navbar = () => {
  return (
    <React.Fragment>
      <nav class="navbar navbar-light bg-dark">
        <span class="navbar-brand mb-0 h1">Navbar</span>
      </nav>
    </React.Fragment>
  );
};

export default Navbar;
